 diaplyed\r\n    When click on the confirm button\r\n    Then Zones page is dispalyed\r\n    When user is clicking on Edge menu\r\n    Then user is not able to see the edge which is deboarded\r\n     Examples:\r\n     | user | SheetName | RowNumber | \r\n     | Admin | Edges | 0 |\r\n     | Admin | Edges | 1 |\r\n     \r\n     \r\n     \r\n@Edges_03 \r\nScenario Outline: Edges end to end scenario\r\n    When user logs into MEC portal<user>\r\n    And user is on Dashboard page\r\n    And user clicks on Edges menu\r\n    Then edges page is displayed\r\n    When  Click on  add new edge option\r\n    Then New edge page is displayed\r\n    When User enter all details <SheetName>, <RowNumber>\r\n    And  User click on submit button\r\n    Then New pre provsion edge is displayed <EdgeId>\r\n    When click on the edge which is to deboard<SheetName>, <RowNumber>\r\n    Then Edge details page is displayed\r\n    When click on manage edge\r\n    Then Manage edge page is displayed\r\n    When click on deboard button\r\n    Then Deboarding warning message popup is diaplyed\r\n    When click on the confirm button\r\n    Then Zones page is dispalyed\r\n    When user is clicking on Edge menu\r\n    Then user is not able to see the edge which is deboarded\r\n    Examples:\r\n    | user | SheetName | RowNumber | \r\n    | Admin | Edges | 0 |\r\n    | Admin | Edges | 1 | \r\n    \r\n@Edges_04\r\nScenario Outline: view the particular edge details\r\n    When user logs into MEC portal<user>\r\n    And user is on Dashboard page\r\n    And user clicks on Edges menu\r\n    Then edges page is displayed\r\n    When click on the edge for the details of edge<SheetName>, <RowNumber>\r\n    Then Edge details page is displayed for the particular edge\r\n    Examples:\r\n     | user | SheetName | RowNumber | \r\n     | Admin | Edges | 0 |\r\n\r\n@Edges_05\r\nScenario Outline: view the list of provisioned edges\r\n    When user logs into MEC portal<user>\r\n    And user is on Dashboard page\r\n nfig update successfully message displayed\r\n    Then click on close button for system config\r\n    And user clicks on Edges menu\r\n    Then edges page is displayed observe status of edge\r\n    Examples:\r\n    | user | SheetName | RowNumber | \r\n    | Admin | Edges | 0 |\r\n    #| Admin | Edges | 1 |\r\n     \r\n    \r\n ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/APATHRUT/OneDrive%20-%20Capgemini/Desktop/E2CO%20PROJECT/Automation/E2COAutomation/E2CO%2520Automation/src/test/resources/Features/WebUITests/E2COTests_Edges.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Edges","id":"9950e65c-da35-45c4-856b-321ac2d8101e"}],"language":"en","keyword":"Feature","name":"Edges Feature","description":"","children":[{"scenario":{"location":{"line":5,"column":1},"tags":[{"location":{"line":4,"column":1},"name":"@Edges_01","id":"897ee589-c151-420d-81a3-067168a70313"}],"keyword":"Scenario Outline","name":"preprovision the edge","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"When ","text":"user logs into MEC portal<user>","id":"0346bacc-930d-4586-88df-343f2570a48f"},{"location":{"line":7,"column":5},"keyword":"And ","text":"user is on Dashboard page","id":"f6c81b4c-c16d-441f-8556-f197b2b30b92"},{"location":{"line":8,"column":5},"keyword":"And ","text":"user clicks on Edges menu","id":"442df759-5f72-4bca-a04b-04bbaa1c251d"},{"location":{"line":9,"column":5},"keyword":"Then ","text":"edges page is displayed","id":"a744fd7d-a82b-44a1-976d-1483b011bc82"},{"location":{"line":10,"column":5},"keyword":"When ","text":"Click on  add new edge option","id":"9a77842e-2376-4ad8-b995-637a18765138"},{"location":{"line":11,"column":5},"keyword":"Then ","text":"New edge page is displayed","id":"b4a8f4d7-c415-400f-88bd-6a8e836c1577"},{"location":{"line":12,"column":5},"keyword":"When ","text":"User enter all details <SheetName>, <RowNumber>","id":"ac7d3132-b7d4-4860-b UT/OneDrive%20-%20Capgemini/Desktop/E2CO%20PROJECT/Automation/E2COAutomation/E2CO%2520Automation/src/test/resources/Features/WebUITests/E2COTests_UserManagement.feature","data":"@UserManagement\r\n\r\nFeature: User Management Feature\r\n\r\n@UserManagement_01\r\n Scenario Outline: Create new user and verify login\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on add new user\r\n \t\tThen add new user page is displayed\r\n \t\tWhen user enter the details of new user<SheetName>, <RowNumber>\r\n \t\tAnd clicks on the submit\r\n \t\tThen created user is displayed\r\n \t\tWhen user logs out\r\n \t\tThen login page is displayed\r\n \t\tWhen user enter username as <username>, password as <pass> and domain as <domainName>\r\n \t\tAnd click on login\r\n \t\tThen user is able to login \r\n \t\tExamples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | UserManagement | 0 |\r\n    | Admin | UserManagement | 1 |\r\n    | Admin | UserManagement | 2 |\r\n    | Admin | UserManagement | 3 |\r\n    \t\r\n@UserManagement_02 \t\t\t\r\nScenario Outline: Developer is not able to create new user\r\n\tWhen user logs into MEC portal<user>\r\n\tAnd user is on dashboard page\r\n\tThen user verifies user management menu is not present for developer\r\n\tExamples:\r\n\t| user |\r\n\t| Developer |\r\n \t\t\r\n \t\t\r\n@UserManagement_03\t\t\r\n Scenario Outline: user is able to delete user\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd  user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on the delete button\r\n \t\tThen user sees popup of confirmation page\r\n \t\tWhen clicks on confirm button\r\n \t\tThen user details are removed\r\n \t\tExamples:\r\n\t\t| user |\r\n\t\t| Admin |\r\n\t\t\r\n@UserManagement_04\r\n\tScenario Outline: Admin is able to inactive the user\r\n\t\tWhen user logs into MEC portal<user>\r\n\t\tAnd  user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on the lock button\r\n \t\tThen user is inactivated\r\n \t\tWhen user logs out\r\n \t\tAnd login page is displayed\r\n \t\tThen user enters the credientials of inactive user and not able to login\r\n \t\tExamples:\r\n \t\t| user |\r\n\t\t| Admin |\r\n\t\r\n@UserManagement_05\t\t\r\nScenario Outline: Admin is able to active the user\r\n\t\tWhen user logs into MEC portal<user>\r\n\t\tAnd  user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on open lock button\r\n \t\tThen user is activated\r\n \t\tWhen user logs out\r\n \t\tAnd login page is displayed\r\n \t\tAnd user enters the credientials of activated user and able to login\r\n \t\tThen user is on the dashboard page as user activated\r\n \t\tExamples:\r\n \t\t| user |\r\n\t\t| Admin |\r\n \t\t\r\n@UserManagement_06 \t\t\r\nScenario Outline: User Management complete end to end scenario\r\n\t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on add new user\r\n \t\tThen add new user page is displayed\r\n \t\tWhen user enter the details of new user<SheetName>, <RowNumber>\r\n \t\tAnd clicks on the submit\r\n \t\tThen created user is displayed\r\n \t\tWhen user logs out\r\n \t\tThen login page is displayed\r\n \t\tWhen user enter username as <username>, password as <pass> and domain as <domainName>\r\n \t\tAnd click on login\r\n \t\tAnd user is on Dashboard page\r\n \t\tThen user is admin or dev verify\r\n \t\tWhen user clicks on User Mangement Menu for UM\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on the delete button\r\n \t\tThen user sees popup of confirmation page\r\n \t\tWhen clicks on confirm button\r\n \t\tThen user details are removed\r\n \t\tWhen user clicks on the lock button\r\n \t\tThen user is inactivated\r\n \t\tWhen user clicks on open lock button\r\n \t\tThen user is activated\r\n \t\tWhen user logs out\r\n \t\tAnd login page is displayed\r\n \t\tAnd user enters the credientials of activated user and able to login\r\n \t\tThen user is on the dashboard page as user activated\r\n \t\t Examples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | UserManagement | 0 |\r\n    #| Admin | UserManagement | 1 |\r\n    #| Admin | UserManagement | 2 |\r\n    #| Admin | UserManagement | 3 |\r\n    \r\n \r\n@UserManagement_07\r\nScenario Outline: user able to edit user and update user\r\n \t\tWhen user logs into MEC portal<user>\r\n \t\tAnd user is on Dashboard page\r\n \t\tAnd user clicks on User Mangement Menu\r\n \t\tThen user management page is displayed\r\n \t\tWhen user clicks on edit button for user to be edit<SheetName>, <RowNumber>\r\n \t\tThen update user page is dispalyed\r\n \t\tWhen update the details for user which is to be required\r\n \t\tAnd Click on update button\r\n \t\tThen user is able to see the updated user successfully popup message\r\n \t\tExamples:\r\n \t\t| user | SheetName | RowNumber |\r\n    | Admin | UserManagement | 0 |\r\n \t\t\r\n  \r\n\r\n\r\n \t\t\r\n \t\t  \r\n \t\t","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/APATHRUT/OneDrive%20-%20Capgemini/Desktop/E2CO%20PROJECT/Automation/E2COAutomation/E2CO%2520Automation/src/test/resources/Features/WebUITests/E2COTests_UserManagement.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@UserManagement","id":"c86e2deb-1b61-4f3e-ba0f-1320291a07b6"}],"language":"en","keyword":"Feature","name":"User Management Feature","description":"","children":[{"scenario":{"location":{"line":6,"column":2},"tags":[{"locatio
